import React, { useState } from 'react';
import axios from 'axios';
import { Dialog, Transition } from '@headlessui/react';
import { ExclamationCircleIcon } from '@heroicons/react/24/outline';

const areas = ['Saude', 'Financas', 'Educacao', 'Marketing', 'Tecnologia', 'Exportacao e Importacao', 'Agricultura', 'Beleza', 'Outro'];
const provincias = ['Bengo', 'Benguela', 'Bie', 'Cabinda', 'Cuanza Norte', 'Cuanza Sul', 'Cuando Cubango', 'Cunene', 'Huambo', 'Huíla', 'Luanda', 'Lunda Norte', 'Lunda Sul', 'Malanje', 'Moxico', 'Namibe', 'Uíge', 'Zaire'];

export function FormularioEmpreendedor() {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    telefone: '',
    provincia: '',
    area_atuacao: '',
    bi: '',
    nome: '',
    data_nascimento: '',
    genero: ''
  });

  const [message, setMessage] = useState(null);
  const [isOpen, setIsOpen] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3001/register/empreendedor', formData);
      setMessage({ type: 'success', text: response.data.message });
      setIsOpen(true);
    } catch (error) {
      setMessage({ type: 'error', text: 'Erro ao registrar empreendedor' });
      setIsOpen(true);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="bg-gray-900 p-8 rounded-lg shadow-lg w-full max-w-4xl">
      <h2 className="text-2xl font-bold text-white mb-3">Registro de Empreendedor</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <div className="col-span-2">
          <label className="block text-gray-400 mb-2">Email</label>
          <input
            type="email"
            name="email"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Senha</label>
          <input
            type="password"
            name="password"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Telefone</label>
          <input
            type="text"
            name="telefone"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.telefone}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Província</label>
          <select
            name="provincia"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.provincia}
            onChange={handleChange}
            required
          >
            <option value="">Selecione</option>
            {provincias.map((provincia) => (
              <option key={provincia} value={provincia}>{provincia}</option>
            ))}
          </select>
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Área de Atuação</label>
          <select
            name="area_atuacao"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.area_atuacao}
            onChange={handleChange}
            required
          >
            <option value="">Selecione</option>
            {areas.map((area) => (
              <option key={area} value={area}>{area}</option>
            ))}
          </select>
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">BI</label>
          <input
            type="text"
            name="bi"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.bi}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Nome</label>
          <input
            type="text"
            name="nome"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.nome}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Data de Nascimento</label>
          <input
            type="date"
            name="data_nascimento"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.data_nascimento}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-span-1">
          <label className="block text-gray-400 mb-2">Gênero</label>
          <select
            name="genero"
            className="w-full p-2 rounded bg-gray-700 text-white focus:ring-transparent"
            value={formData.genero}
            onChange={handleChange}
            required
          >
            <option value="">Selecione</option>
            <option value="Masculino">Masculino</option>
            <option value="Feminino">Feminino</option>
            <option value="Outro">Outro</option>
          </select>
        </div>
      </div>
      <Transition show={isOpen} as={React.Fragment}>
        <Dialog
          as="div"
          className="fixed inset-0 z-10 overflow-y-auto"
          onClose={() => setIsOpen(false)}
        >
          <div className="min-h-screen px-4 text-center">
            <Transition.Child
              as={React.Fragment}
              enter="ease-out duration-300"
              enterFrom="opacity-0"
              enterTo="opacity-100"
              leave="ease-in duration-200"
              leaveFrom="opacity-100"
              leaveTo="opacity-0"
            >
              <Dialog.Overlay className="fixed inset-0 bg-black bg-opacity-50" />
            </Transition.Child>

            <span className="inline-block h-screen align-middle" aria-hidden="true">
              &#8203;
            </span>

            {message && (
              <Transition.Child
                as={React.Fragment}
                enter="ease-out duration-300"
                enterFrom="opacity-0 scale-95"
                enterTo="opacity-100 scale-100"
                leave="ease-in duration-200"
                leaveFrom="opacity-100 scale-100"
                leaveTo="opacity-0 scale-95"
              >
                <div className="inline-block w-full max-w-md p-6 my-8 overflow-hidden text-left align-middle transition-all transform bg-white shadow-xl rounded-lg">
                  <div className="flex items-center">
                    <ExclamationCircleIcon className={`h-6 w-6 mr-2 ${message.type === 'error' ? 'text-red-500' : 'text-green-500'}`} aria-hidden="true" />
                    <Dialog.Title as="h3" className="text-lg font-medium leading-6 text-gray-900">
                      {message.type === 'error' ? 'Erro' : 'Sucesso'}
                    </Dialog.Title>
                  </div>
                  <div className="mt-2">
                    <p className="text-sm text-gray-500">
                      {message.text}
                    </p>
                  </div>
                  <div className="mt-4">
                    <button
                      type="button"
                      className="inline-flex justify-center px-4 py-2 text-sm font-medium text-blue-900 bg-blue-100 border border-transparent rounded-md hover:bg-blue-200"
                      onClick={() => setIsOpen(false)}
                    >
                      Fechar
                    </button>
                  </div>
                </div>
              </Transition.Child>
            )}
          </div>
        </Dialog>
      </Transition>
      <button type="submit" className="mt-4 bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
        Registrar
      </button>
    </form>
  );
}
